import React, { useState, useEffect } from 'react';

function PlayerInfo({object}) {
  const objectProperties = Object.entries(object);

  
  return (
    <div>
      {objectProperties.map(([key, value]) => (
        <div key={key}>
          <p>{key}:</p> {value.toString()}
        </div>
      ))}
      
    </div>
  );
}

export default PlayerInfo;
